webpackJsonp([0x5eb8919f623c],{4204:function(i,a){i.exports={data:{markdownRemark:{html:'<h2>概要</h2>\n<p>太ったフォルダを探し、リストアップして記録を残すツールです。</p>\n<h2>特徴</h2>\n<ul>\n<li>検索結果はでExcelワークブックファイルに出力されます。一目で分かるグラフ付きです。</li>\n<li>処理中はGUIによる分かりやすい進捗表示付きです。</li>\n<li>ネットワークフォルダ(FTP除く)にも対応しています。エクスプローラで読み書き出来る場所なら大抵OKです。</li>\n<li>\n<p>実態はJavascriptですので、無許可のEXEファイルを使っちゃまずいようなIT系の職場でもまぁｺﾞﾆｮｺﾞﾆｮ</p>\n<h2>ダウンロード</h2>\n</li>\n</ul>\n<ul>\n<li>動作環境: Microsoft Windows98/2000～XP(Vista以降は、検索対象とするフォルダによっては一工夫必要となります)、Microsoft Office Excel XP(2002)以降</li>\n<li>最終更新: 2008/2/10</li>\n<li><a href="/filez/app/java/PizzaManFinder_1.0.1.zip">ダウンロード</a> ([filesize]<a href="https://danmaq.com/filez/app/java/PizzaManFinder_1.0.1.zip%5B/filesize%5D">https://danmaq.com/filez/app/java/PizzaManFinder_1.0.1.zip[/filesize]</a>)</li>\n</ul>',frontmatter:{cover:null,date:"2007-11-26T00:00:00+09:00",strDate:"2007/11/25",title:"PizzaManFinder - 太ったフォルダ検索ツール"}}},pathContext:{path:"/ja/blog/2007/11/26-pizzamanfinder-太ったフォルダ検索ツール/",langKey:"ja"}}}});
